import "./Navbar.css";
import image from "../assets/home_bg_img.png";
import { Link } from "react-router-dom";

const NavbarComponent = () => {
  return (
    <div>
      <div className="container-fluid w-full flex flex-wrap items-center justify-between px-6">
        <div className="container-fluid">
          <a className="text-xl text-black" href="#">
            Navbar
          </a>
        </div>
      </div>
      <nav className="fixed w-full flex justify-between p-4 items-center">
        <ul className=" md:flex flex-wrap gap-8">
          <li className="text-black ">
            <Link to="#">Home</Link>
          </li>
          <li className="text-black ">
            <Link to="#">Trip Planner</Link>
          </li>
          <li className="text-black">
            <Link to="#">Login</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
